// SPDX-License-Identifier: MIT
pragma solidity >=0.6.12 <0.9.0;

import "./contracts.sol";

contract ContractManagment is Contracts {

    constructor(address userAddress) Contracts(userAddress) {
    }

    enum VoteType {
        voteFor, voteAgainst
    }

    event newContractCreated(string name, uint256 contractId);
    event contractorSealed(address userAddress);
    event contractorClosed(address userAddress);
    event contractorRegistered(address userAddress, uint256 contractId);
    event contractorAdded(address userAddress, uint256 contractId);
    event contractExecuted(address userAddress, uint256 contractId);

    function createContract(
        string memory _name,
        string memory _terms,
        address _payableUserAddress,
        address[] memory participants,
        string memory _organizationId,
        ContractType _contractType,
        uint256 amount
    ) external returns (uint256) {
        require(
            participants.length % 2 != 0,
            "An even number of particpants is not allowed."
        );
        uint256 _id = uint256(
            keccak256(abi.encodePacked(block.timestamp, msg.sender))
        );

        Contract storage newContract = ContractMgt[_id];
        newContract.name = _name;
        newContract.terms = _terms;
        newContract.contractState = ContractState.Created;
        newContract.payableUserAddress = _payableUserAddress;
        newContract.payeeAddress = msg.sender;
        newContract.contractType = _contractType;
        newContract.numberOfParticipants = uint32(participants.length);
        newContract.amount = amount;

        for (uint256 i = 0; i < participants.length; i++) {
            ContractingParties[participants[i]].push(_id);
        }

        OrgContracts[_organizationId].push(_id);

        emit newContractCreated(_name, _id);

        return _id;
    }

    function sealContract(uint256 _contractId) external returns (bool) {
        require(
            ContractMgt[_contractId].contractState == ContractState.Canceled,
            "Contract can not be sealed"
        );
        require(
            ContractMgt[_contractId].hasPaidToContractAdmin,
            "Contract has not paid. It can not be sealed"
        );

        ContractMgt[_contractId].contractState = ContractState.Sealed;

        return true;
    }

    function getMyOrgContracts(string memory _orgId)
        external
        view
        returns (Contract[] memory)
    {
        uint256[] memory contractIds = OrgContracts[_orgId];

        Contract[] memory contracts = new Contract[](contractIds.length);

        for (uint256 i = 0; i < contractIds.length; i++) {
            contracts[i] = ContractMgt[contractIds[i]];
        }

        return contracts;
    }

    function getMyAssignedContracts()
        external
        view
        returns (Contract[] memory)
    {
        uint256[] memory contractIds = ContractingParties[msg.sender];

        Contract[] memory contracts = new Contract[](contractIds.length);

        for (uint256 i = 0; i < contractIds.length; i++) {
            contracts[i] = ContractMgt[contractIds[i]];
        }

        return contracts;
    }

    function getContract(uint256 _contractId) external view returns (Contract memory) {
        return ContractMgt[_contractId];
    }

    function castVote(uint _contractId, VoteType _voteType) external  {
        Contract memory contractItem = ContractMgt[_contractId];
        require(contractItem.contractState == ContractState.Sealed, "Voting on this contract is not allowed.");
        if(_voteType == VoteType.voteFor) {
            contractItem.forVotes++;
        } else if(_voteType == VoteType.voteAgainst) {
            contractItem.againstVotes++;
        }
        executeContract(contractItem, _contractId);
    } 

    function executeContract(Contract memory _contractItem, uint _contractId) internal  {
        if (_contractItem.forVotes > _contractItem.numberOfParticipants/2) {
            makePayment(_contractItem.payableUserAddress, _contractItem.amount);
            _contractItem.contractState = ContractState.Executed;  
        } else if(_contractItem.againstVotes > _contractItem.numberOfParticipants/2) {
            makePayment(_contractItem.payeeAddress, _contractItem.amount);
            _contractItem.contractState = ContractState.Executed;
        }
        emit contractExecuted(msg.sender, _contractId);
    }

    function makePayment(address _to, uint256 _amount) public payable {
        require(_to != address(0), "Invalid recipient address");
        require(_amount > 0, "Amount must be greater than zero");

        (bool success, ) = _to.call{value: _amount}("");
        require(success, "Transfer failed");
    }
}

contracts/contracts.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.6.12 <0.9.0;

import "@openzeppelin/contracts/access/Ownable.sol";

contract Contracts is Ownable {
    address payable ownerAddress;
    uint totalAmount = 0; 
        
    event Received(address indexed sender, uint256 amount);
    event Logger(string logger);

    enum ContractState {
        Created,
        Sealed,
        Canceled,
        Executed
    }
    enum ContractType {
        Consensus,
        Majority
    }

    struct Contract {
        string name;
        string terms;
        ContractState contractState;
        ContractType contractType;
        uint32 numberOfParticipants;
        uint32 forVotes;
        uint32 againstVotes;
        uint256 amount;
        address payableUserAddress;
        address payeeAddress;
        bool hasPaidToContractAdmin;
    }

    mapping(uint256 => Contract) ContractMgt;
    mapping(string => uint256[]) OrgContracts;
    mapping(address => uint256[]) ContractingParties;

    constructor(address _ownerAddress) Ownable(_ownerAddress) {
        ownerAddress = payable(msg.sender);
    }

    function getTotalAmount() external view onlyOwner returns (uint){
        return totalAmount;
    }

    receive() external payable {
        totalAmount += msg.value;
        emit Received(msg.sender, msg.value);
    }

    function payToContractAdmin(address _payeeAddress, uint256 _contractId) external payable {
        emit Logger("first");
        Contract memory currentContract  = ContractMgt[_contractId];
        emit Logger("second");
        (bool success,) =  _payeeAddress.call{value: currentContract.amount}(
            abi.encodeWithSignature("updateContractStatus(uint256)", _contractId)
        );
        require(success, "Payment is not completed"); 
    }

    function updateContractStatus(uint256 _contractId) public payable returns (bool){ 
        ContractMgt[_contractId].hasPaidToContractAdmin = true;
        return true;
    }

}

